import React from 'react';
import { Switch, Route } from 'react-router-dom';

import LandingPage from './landingpage';
import AboutMe from './aboutme';
import Contact from './contact';
import Project from './project';
import Resume from './resume';


const Main = () => (
    <Switch>
        <Route path="/patrikhogler" exact component={LandingPage} />
        <Route path="/patrikhogler/aboutme" component={AboutMe} />
        <Route path="/patrikhogler/contact" component={Contact} />
        <Route path="/patrikhogler/project" component={Project} />
        <Route path="/patrikhogler/resume" component={Resume} />
    </Switch>
)

export default Main;
